import './App.css';
import React from 'react';
import { Button, Dropdown, Space } from 'antd';
import { PlusOutlined } from '@ant-design/icons';

const menu = (
  <Menu
    onClick={handleMenuClick}
    items={[
      {
        label: '1st menu item',
        key: '1',
        icon: <PlusOutlined />,
      },
      {
        label: '2nd menu item',
        key: '2',
        icon: <PlusOutlined />,
      },
      {
        label: '3rd menu item',
        key: '3',
        icon: <PlusOutlined />,
      },
    ]}
  />
);

function App() {
  function printer(e) {
    console.log(e);
    console.log("here");
  }

  return (
    <div>
      <body className="App-header">
        <Dropdown overlay={menu}>
          <Button>
            <Space>
              Button
              <PlusOutlined />
            </Space>
          </Button>
        </Dropdown>
      </body>
    </div>
  );
}

export default App;
